import React , { useRef } from "react";
import Fade from 'react-reveal/Fade';
import "./Contact.css";
import emailjs from '@emailjs/browser';

 const Contact = () => {
  const form = useRef();

  const sendEmail = (e) => {
    e.preventDefault();

    emailjs.sendForm('YOUR_SERVICE_ID', 'YOUR_TEMPLATE_ID', form.current, 'esZjgPXOy7tDK1m1L')
      .then((result) => {
          console.log(result.text);
      }, (error) => {
          console.log(error.text);
      });
  };

  return (
    <Fade top>
    <h1 >Contact Me</h1>
    <form ref={form} onSubmit={sendEmail}>
      <input className='input_type' type="text" name="user_name" placeholder="Your name"/>
      <br />
      <input className='input_type' type="email" name="user_email" placeholder="Your email" />
      <br />
      <textarea className='input_type' name="message" placeholder="Your message" />
      <br />
      <input id='button' className='grow' type="submit" value="Send" />
    </form>
    </Fade>
  );
};

export default Contact;
